(function() {

  function get_google_image () {
    return 'data:image/png;base64,';
  }

  var css = "#body[class=\"ctr-p\"]\n  { \n    background: url(" + get_google_image() + ") no-repeat center top !important;\n background-size: 275px 134px !important;\n margin-top: 105px; }\n  #hplogo, #gbqlw img\n  {  \n    height: 0 !important;\n    width: 0 !important;\n    display: none !important;\n  }\n  \n  #gbqlw.gbes\n  {\n    padding-top: 20px !important;\n  }\n\n  #gbqlw\n  {\n    width: 113px !important;\n    height: 50px !important;\n    font-size: 0 !important;\n    margin-left: 25px !important;\n    margin-top: -5px !important;\n    padding-right: 65px !important;\n    padding-top: 25px !important;\n    background: url(" + get_google_image() + ") no-repeat left top !important;\n    background-size: 170px 80px !important;\n  }\n  .gbt.gbqfh #gbqfw {\n  margin-left: 0px !important;\n  }\n  .gbt #gbqfw {\n  margin-left:66px !important;\n  }\n\n  .gbqfh #gbql, #gbql\n  {\n     display: none !important;\n  }";
  if (typeof GM_addStyle != "undefined") {
    GM_addStyle(css);
  } else if (typeof PRO_addStyle != "undefined") {
    PRO_addStyle(css);
  } else if (typeof addStyle != "undefined") {
    addStyle(css);
  } else {
    var node = document.createElement("style");
    node.type = "text/css";
    node.appendChild(document.createTextNode(css));
    var heads = document.getElementsByTagName("head");
    if (heads.length > 0) {
      heads[0].appendChild(node); 
    } else {
      // no head yet, stick it whereever
      document.documentElement.appendChild(node);
    }
  }
})();
